description:
Provides dinamic filtering of parts and exports from an underlying reflection-based catalog using a simple lambda expression that can inspect the export, its metadata and its exporting reflected type (part).

Example: var filtered = new FilteringReflectionCatalog(innerCatalog)
{
	// Filter all parts that don't have an "IsPublic" metadata
	PartFilter = part =>
	part.PartDefinition.Metadata.ContainsKey("IsPublic")
};

Smart internationalization for .NET web apps;
    Globally recognized interface; localize like the big kids
    Localizes everything; controller calls, views, validation attributes, and routes.

Provides strong-typed persistence of data in an AppDomain, which can also be transient and automatically removed on dispose.  

Usage: AppDomain.CurrentDomain.SetData<Foo>(foo);
var saved = AppDomain.CurrentDomain.GetData<Foo>();

Traverse an enumerable tree, depth or breadth first. 
Example:

var dirs = new DirectoryInfo("C:\\")
	.Traverse(TraverseKind.BreadthFirst, dir => dir.EnumerateDirectories());
